import React from 'react';

function QuotesPageHeader({logOut, fullName, toggleAdd, toggleAddForm}){
    return(
        <header>
            <form className="log-out-form">
                <button onClick={logOut}>Log Out</button>
            </form>

            <div className="title-line">
                <h1>{fullName+"'s Quotes"}</h1>
                <button onClick={toggleAddForm} style={toggleAdd ? {backgroundColor: "#E84855"} : null}>{toggleAdd ? "Discard" : "Add a Quote"}</button>
            </div>
        </header>
    );
}

export default QuotesPageHeader;
